import React, { Component } from 'react'
import { connect } from 'react-redux';
import { sideDrawerAction } from './redux/actions/sideDrawerController.js'
import { ReactComponent as Menu } from '../assets/menu.svg'

class Header extends React.Component {
  constructor() {
    super()
    this.state = {}
  }

  render() {
    return (
      <div className='navbarContain'>
        <Menu className='menuIcon' onClick={() => this.props.sideDrawerAction(true)} />
      </div>
    )
  }
}

function mapDispatchToProps(dispatch) {
  return {
    sideDrawerAction: modalState => dispatch(sideDrawerAction(modalState))
  };
}

export default connect(null, mapDispatchToProps)(Header);
